import './App.css';
import Navbar from "./components/Navbar"
import Card from "./components/Card"
import data from "./data"

const cards = data.map(cardData => {
  return (
    <Card data={cardData} />
  )
}
)

function App() {
  return (
    <div className="App">
      <Navbar />
      <cards />

    </div>


  )
}

export default App;
